export default class GetBranchesResponse {

    /**
     * @type {Array<BranchOverviewModel>}
     */
    branches;

    /**
     * @type {number}
     */
    pagesCount;

    constructor(jsonMap){
        console.log(jsonMap);
        this.pagesCount = 2; // branches do not include last page info in meta unlike what is specified in pagination section.
    }

}
